import React from "react";
import "./Row_List.css";
import Row from '../Row/Row';

// create 5 rows in a vertical fashion
const Row_List = () => {
    return(
        <div style={row_list}>
            <Row />
            <Row />
            <Row />
            <Row />
            <Row />
        </div>
    );
}

export default Row_List;
